// components/Home.js

import React from 'react';
import { Link } from 'react-router-dom';
import './App.css';

function Home() {
  return (
    <div className="home">
      <h1>Welcome to the Hotel Booking App</h1>
      <p>This is the home page of the application. Use the navigation above to explore different sections.</p>
      <div className="navigation-buttons">
        <Link to="/hotels" className="nav-button">Hotels</Link>
        <Link to="/rooms" className="nav-button">Rooms</Link>
        <Link to="/customers" className="nav-button">Customers</Link>
        <Link to="/bookings" className="nav-button">Bookings</Link>
        <Link to="/reviews" className="nav-button">Reviews</Link>
      </div>
    </div>
  );
}

export default Home;
